import React from 'react';
import styled from 'styled-components';
import logoImg from '../data/img/logo.png'
import titleImg from '../data/img/start_title_big.png'

const HOME = () => {
    return(
        <MainWrapper>
            <ImageCommon src={logoImg}/>
            <ImageCommon src={titleImg}/>
            <p>다가오는 2021년을 기다리며 다정페이와 함께<br/>한 해를 돌아보고 다정(情)펀딩을 해보시는 건 어떠신가요?</p>
        </MainWrapper>
    )
}

const MainWrapper = styled.div`
    width : 532px;
    margin : 0 auto;
    border : 1px solid blue;
`

const ImageCommon = styled.img`
    border : 1px solid red;
    margin : 0 auto;
    display : block;
`

export default HOME;
